housingAssignment.query:
query getHousingAssignments($personId: ID, $periods: [String]){
                            housingAssignments : {housingAssignments}(
                                filter: {
                                    status: { IN: [assigned] },
                                    {person}: {
                                        id:{ EQ: $personId }
                                    },
                                    {academicPeriod}: {
                                        code: { IN: $periods }
                                    }
                                },
                                sort: { startOn: DESC }
                            )
                            {
                                edges {
                                    node {
                                        id
                                        academicPeriod : {academicPeriod} {
                                            id
                                            code
                                        }
                                        person : {person} {
                                            id
                                        }
                                        room : {room} {
                                            id
                                            title
                                            description
                                            number
                                            floor
                                            building : {building@buildings} {
                                                id
                                                title
                                                description
                                            }
                                        }
                                        request : {request@housingRequests} {
                                            id
                                        }
                                        status
                                        startOn
                                        endOn
                                    }
                                }
                            }
                        }

