instructional-events-by-section.query:
query instructionalEventsBySection($sectionId: ID){
  instructionalEvents : {instructionalEvents}(
    filter: {
      {section}: {
        id: {EQ: $sectionId}
      }
    }
  ){
    edges {
      node {
        id
        recurrence {
          timePeriod {
            startOn,
            endOn
          }
          repeatRule {
            type
            interval
            ends {
              repetitions,
              date
            }
            daysOfWeek
            repeatBy {
              dayOfMonth,
              dayOfMonth
            }
          }
        }
        locations {
          location {
            room: {room} { 
              number
              building: {building} {
                title
              }
            }
          }
        }
      }
    }
  }
}

today-sections.query:
query todaysSections($personId: ID, $yesterday: Date, $tomorrow: Date){
    sectionRegistrations : {sectionRegistrations}(
        filter: {
          {registrant@persons}: {
              id: {EQ: $personId}
          }
          {section}: {
              startOn: {BEFORE: $tomorrow}
              endOn: {AFTER: $yesterday}
          }
        }
    ){
        edges {
            node {
                sections: {section} {
                    id
                    course: {course} {
                        titles {
                            value
                        }
                        number
                        subject: {subject} {
                            abbreviation
                        }
                    }
                }
            }
        }
    }
}

